sys_variable_value.value:
(function execute(inputs, outputs) {

  var numItems = parseInt(gs.getProperty('x_snc_meetup_com.page_size', 20), 10);
  var requestBody = new GraphQL().setupMessage('get-past-group-events-paginated', {
    "urlname"  : inputs.group_url,
    "itemsNum" : numItems,
    "cursor"   : null
  });

  outputs.request_body = requestBody;

})(inputs, outputs);

